<span class="line"><span style="color:#F8F8F2">        x </span><span style="color:#F92672">=</span><span style="color:#F8F8F2"> torch.relu(</span><span style="color:#FD971F">self</span><span style="color:#F8F8F2">.fc2(x))</span></span>
